import { Row, Col } from "react-bootstrap";

import style from "./css/Market.module.css";

const Market = () => {
  return (
    <>
      <Row className={style["background"]}>
        <Row>
          <Row className={style["marketHead"]}>
            <div>이적 시장</div>
          </Row>
          <Row className={style["clubBody"]}>
            <Col>
              <Row>선수 목록</Row>
              <Row>선수 목록 몸통</Row>
            </Col>
            <Col>
              <Row>예산 관련</Row>
              <Row></Row>
            </Col>
          </Row>
        </Row>
      </Row>
    </>
  );
};

export default Market;
